          className="search"
          id="filled-basic"
          label="원하는 단어나 문장을 입력해 주세요."
        // onChange={(e)}
        />
        <button
          className="search_button"
        //  onClick = {setChecked(true)}
        >
          검색
        </button>
      </div>
    </div>
  )
}
